import { Box, Center, Grid, createStyles, Text, Flex, Container,Image } from '@mantine/core'
import React, { useEffect, useState } from 'react'

import p2 from "../assets/p2.png"
import p5 from "../assets/p5.png"
// import NavBar from './NavBar';

export default function Home() {
    const { classes } = useStyle()
    return (
        <>

                <div>



                    <Box id='#' m={0} p={0}>
                        <Box className={classes.bgVideo} >
                           <Image src={p2}/>

                            <Container size="90%">

                                <Grid className={classes.textOver}>

                                    <Grid.Col md={6} lg={6}>
                                        <Center>

                                            <Box className={classes.textContant} >
                                                Making Your Move Quick  & Easy

                                            </Box>
                                        </Center>

                                    </Grid.Col>
                                    <Grid.Col md={6} lg={6} >

                                    </Grid.Col>

                                    <Flex mt={50} sx={(theme => ({ '@media (max-width: 1280px)': { display: "none" } }))}>

                                        <Box className={classes.box2}>

                                            <Text fs={18} fw={600} >

                                                CALL US
                                            </Text>

                                            123-456-789

                                        </Box>
                                        <Box md={6} className={classes.box1}>

                                            <Text fs={18} fw={600} >

                                                START ONLINE
                                            </Text>

                                            Get a free moving
                                            <br /> quote in seconds
                                        </Box>

                                    </Flex>
                                </Grid>



                            </Container>
                        </Box >
                        <Container size="90%" data-Aos="zoom-in">
                            <Box style={{
                                height: "50vh",
                                // background: "red",
                                display: "flex",
                                alignItems: "center",
                                justifyContent: "center",
                                backgroundImage: `url(${p5})`,

                                color: "black"
                            }}>
                                <Center style={{
                                    fontSize: "350%",
                                    verticalAlign: "middle",
                                    fontWeight: 700,
                                }}> <Text data-Aos="fade-up"> Movers You Can Trust</Text></Center>
                            </Box>
                            <Grid>
                                <Grid.Col md={4} lg={4}>
                                    <Box style={{
                                        height: "20vh",
                                        background: "black",
                                        display: "flex",
                                        alignItems: "center",
                                        justifyContent: "center",
                                    }}>
                                        <Text style={{
                                            verticalAlign: "middle",
                                            color: "#fff",
                                            fontSize: "32px"

                                        }}>

                                            Long Distance Moving
                                        </Text>
                                    </Box>
                                </Grid.Col>
                                <Grid.Col md={4} lg={4} >
                                    <Box style={{
                                        height: "20vh",
                                        background: "#ff5829",
                                        display: "flex",
                                        alignItems: "center",
                                        justifyContent: "center",
                                    }}>
                                        <Text style={{
                                            verticalAlign: "middle",
                                            color: "#fff",
                                            fontSize: "32px"

                                        }}>

                                            Full Value Insurance
                                        </Text>
                                    </Box>
                                </Grid.Col>
                                <Grid.Col md={4} lg={4} >
                                    <Box style={{
                                        height: "20vh",
                                        display: "flex",
                                        alignItems: "center",
                                        justifyContent: "center",
                                        background: "whitesmoke"
                                    }}>
                                        <Text style={{
                                            verticalAlign: "middle",

                                            fontSize: "32px"

                                        }}>


                                            95% Referral Rate
                                        </Text>
                                    </Box>
                                </Grid.Col>

                            </Grid>
                            <Box style={{
                                height: "50vh",
                                display: "flex",
                                alignItems: "center",
                                justifyContent: "center",
                            }}>
                                <Center style={{
                                    fontSize: "350%",
                                    verticalAlign: "middle",
                                    fontWeight: 700,
                                }}> <Text> Our Happy Customers</Text>

                                </Center>
                            </Box>
                            <Box style={{

                                display: "flex",
                                alignItems: "center",
                                justifyContent: "center",
                            }}>
                                <Center style={{
                                    // fontSize: "350%",
                                    verticalAlign: "middle",
                                    // fontWeight: 700,
                                }}>
                                </Center>
                            </Box>
                        </Container>
                    </Box >
                </div>

        </>
    )
}
const useStyle = createStyles((theme) => ({

    bgVideo: {
        width: "100%",


    },
    videoplayer: {
        width: "inherit",
        zIndex: -1,
