            top: '20%',


        },


    },
    textContant: {
        fontWeight: 800,
        color: "#fff",
        fontSize: "80px",
        '@media (max-width: 768px)': {
            fontSize: "40px"

        },
    },
    box1: {
        background: "#ff5829",
        padding: "40px",
        "&:hover": {
            cursor: "pointer"
        }
    },
    box2: {
        background: "black",
        padding: "40px",

        color: '#fff',
        "&:hover": {
            cursor: "pointer"
        }
    },

    loaderBox: {
        height: "100vh",
